// contracts/GLDToken.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

contract clientHandler is Ownable, Pausable {
    using Math for uint256;
    address _token;
    mapping (address => uint256)  _balances;
    mapping (address => uint256)  _size;
    // mapping (uint256 => address)  _accouts;
   
    // uint256 _accoutCount; //
    event AdminDeposited(address indexed  sender,address indexed  to, uint256 amount);
    event AdminWithdrawed(address indexed  sender,address indexed  to, uint256 amount);

    event StoreDeposited(address indexed sender,address indexed  to,string indexed chainId, uint256 amount,uint256 nonce);
    event StoreWithdrawed(address indexed sender,address indexed  to,string indexed chainId, uint256 amount,uint256 nonce);

    event StoreOrderPay(address indexed  sender,address indexed  to, string indexed hashid, uint256 amount, uint256 size,uint256 nonce);
    event StoreOrderExpirationed(address indexed  sender,address indexed  to, string indexed hashid, uint256 size,uint256 nonce);


    
    event Deposited(address indexed  sender,uint256 amount);
    event Withdrawed(address indexed   sender, uint256 amount);
    event StoreAdminshipTransferred(address indexed newAdmin, address indexed oldAdmin);


    address _storeadmin; //存储账户
    uint256 _storeAmount; //用户总充值余额
    uint256 _storeSize; //用户总存储空间
    uint256 _nonce; //存储账户交易次数
    

    constructor(address storeadmin,address erc20token) Ownable() {
        _storeadmin = storeadmin;
        _token = erc20token;
    }
    // 给合约充值（ERC20）,便于用户提现，直接转账更好，可选
    function adminDeposit(uint256 amount) public {  
        // uint256 allowance = IERC20(_token).allowance(msg.sender, address(this));
        // require(allowance >= amount, "Check the token allowance");
        require(IERC20(_token).transferFrom(msg.sender, address(this), amount),"admin Deposit fail");
        emit AdminDeposited(msg.sender,msg.sender,amount);
    }
    // 管理账户提现（ERC20）
    function adminWithdraw(address to, uint256 amount) public onlyOwner {
        uint256 balance = IERC20(_token).balanceOf(address(this));
        require(balance>=amount, "contract insufficient balance");
        require(IERC20(_token).transfer(to, amount),"admin withdraw fail");
       emit AdminWithdrawed(msg.sender,to,amount);
    }

    modifier onlyStoreOwner() {
        require(getStoreadmin() == _msgSender(), "Ownable: caller is not the owner");
        _;
    }
    // 存储管理员账户帮用户账户充值
    function storeDeposit(address to, uint256 amount,string memory chainId) public onlyStoreOwner whenNotPaused  {  
       // IERC20(_token).transfer(to, amount);
       _balances[to] += amount;
       _storeAmount += amount;
       _nonce+=1;
       emit  StoreDeposited(msg.sender,to,chainId,amount,_nonce);      
    }
  // 存储管理员账户帮用户账户提现
  function storeWithdraw(address to, uint256 amount,string memory chainId) public onlyStoreOwner whenNotPaused {
    require(_storeAmount>=amount, "contract insufficient balance");
    _storeAmount -= amount;
    require(_balances[to]>=amount, "user  insufficient balance");
    _balances[to] -= amount;
     _nonce+=1;
    emit StoreWithdrawed(msg.sender,to,chainId,amount,_nonce);
  }

    // 存储管理员账户扣款用户订单余额,记录用户存储信息；
  function storeOrderpay(address to,string memory hashid, uint256 amount,uint256 size)  public onlyStoreOwner whenNotPaused{ 
        require(_balances[to]>=amount, "user insufficient balance"); 
        require(_storeAmount>=amount, "contract insufficient balance");
        _balances[to] -= amount;
         _storeAmount -= amount;
        _size[to] += size;
        _storeSize += size;
        _nonce+=1;
       emit StoreOrderPay(msg.sender,to ,hashid,amount, size,_nonce);
    }


    // 存储管理员 处理订单到期数据
    function storeOrderExpiration(address to,string memory hashid, uint256 size)  public onlyStoreOwner whenNotPaused{ 
        require(_size[to]>=size, "user insufficient balance"); 
        require(_storeSize>=size, "contract insufficient balance");
        _size[to] -= size;
        _storeSize -= size;
        _nonce+=1;
       emit StoreOrderExpirationed(msg.sender,to ,hashid,size,_nonce);
    }
    

  // 用户提现
  function withdraw(uint256 amount) public whenNotPaused {
    require(_storeAmount>=amount, "contract insufficient balance");
    _storeAmount -= amount;
    require(_balances[msg.sender]>=amount, "user  insufficient balance");
    _balances[msg.sender] -= amount;
    require(IERC20(_token).transfer(msg.sender, amount),"user withdraw fail");
    emit Withdrawed(msg.sender,amount);
  }
    // 用户充值
  function deposit(uint256 amount) public whenNotPaused {
    require(IERC20(_token).transferFrom(msg.sender, address(this), amount),"user deposit fail");
    _storeAmount += amount;
    _balances[msg.sender] += amount;
    emit Deposited(msg.sender,amount);
  }
  
   //用户存储账户余额
   function balanceOf(address account) public  view returns (uint256) {
      return _balances[account];
   }
      //用户存储账户余额
   function StoreSize(address account) public  view returns (uint256) {
      return _size[account];
   }
       //用户总存储空间
   function getStoreAllSize() public  view returns (uint256) {
      return _storeSize;
    }

    //用户总余额
   function getStoreAmount() public  view returns (uint256) {
      return _storeAmount;
    }
   function getStoreadmin() public  view returns (address) {
      return _storeadmin;
    }
   function getToken() public  view returns (address) {
      return _token;
    }
    
   function setToken(address newtoken) public onlyOwner  {
     _token = newtoken;
   }
   function transferStoreAdminship(address newStoreAdmin) public onlyStoreOwner whenNotPaused  {
     address oldStoreAdmin = _storeadmin;
     _storeadmin = newStoreAdmin;
     emit StoreAdminshipTransferred(oldStoreAdmin, newStoreAdmin);
   }
    
   function setStoreAdmin(address newStoreAdmin) public onlyOwner  {
     address oldStoreAdmin = _storeadmin;
     _storeadmin = newStoreAdmin;
     emit StoreAdminshipTransferred(oldStoreAdmin, newStoreAdmin);
   }
   
}
